gt = da.from_array(d, chunks=(1,chunx,chuny))\n    # Construct a lazy task graph \n    print(\"gt array\", gt, flush=True)\n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n    # Submit the task graph to the scheduler\n    s = client.persist(cpt)\n    print(\"result \", client.compute(s).result(), flush=True)       \n\nprint(\"Done in \", time.time() - t, flush=True)\nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"coordinates":null,"group":null,"items":[{"id":"1335"},{"id":"1363"}]},"id":"1334","type":"Legend"},{"attributes":{"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"memory"}},"id":"1275","type":"Line"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"cpu"}},"id":"1244","type":"Line"},{"attributes":{},"id":"1376","type":"LinearScale"},{"attributes":{"source":{"id":"1213"}},"id":"1341","type":"CDSView"},{"attributes":{"coordinates":null,"group":null},"id":"1415","type":"Title"},{"attributes":{},"id":"1374","type":"LinearScale"},{"attributes":{},"id":"1300","type":"ResetTool"},{"attributes":{},"id":"1473","type":"BasicTickFormatter"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"field":"bandwidth","transform":{"id":"1151"}},"hatch_alpha":{"value":0.2},"hatch_color":{"field":"bandwidth","transform":{"id":"1151"}},"height":{"value":1},"line_alpha":{"value":0.2},"line_color":{"field":"bandwidth","transform":{"id":"1151"}},"width":{"value":1},"x":{"field":"source"},"y":{"field":"destination"}},"id":"1173","type":"Rect"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{},"id":"1474","type":"AllLabels"},{"attributes":{"start"
